window.bookSummaryJSON = "I didn’t intend for it to happen this way. But then again, I never did. No, it was what others had intended for me that was the problem and this had all started yet again with a witch and a double cross. We had made it to the portal, only a trip back to Lucius’ Kingdom wasn’t on the cards. Because now we were to face a new enemy, one with a handsome face, a killer smile and a land full of Dragons! Now we had once again been pushed down the rabbit hole, and this was as far from Wonderland as you can get! For we were not in Kansas Hell anymore. No, this was the Elemental Realm of Fae and here, there was one ruler who knew I was coming. In fact… He was counting on it."; 
